def solve(input: str) -> tuple[int, int]:
  begin, end = 0, 1
  result: list[int] = []
  for target in (4, 14):
    while end - begin < target:
      pos = input.find(input[end], begin, end)
      if pos != -1:
        begin = pos + 1
      end += 1
    result.append(end)
  return tuple(result)

assert solve("mjqjpqmgbljsphdztnvjfqwrcgsmlb") == (7, 19)
assert solve("bvwbjplbgvbhsrlpgdmjqwftvncz") == (5, 23)
assert solve("nppdvjthqldpwncqszvftbrmjlhg") == (6, 23)
assert solve("nznrnfrfntjfmvfwmzdfjlvtqnbhcprsg") == (10, 29)
assert solve("zcfzfwzzqfrljwzlrfnpqdbhtmscgvjw") == (11, 26)
print(solve(""))
